import React from 'react'

class Transaction extends React.Component{

    render(){
        return <div>
            <form>
                <label >Amount</label>
                <input type="number" name="amount" /><br></br>
                <button type="submit">{this.props.name}</button>
            </form>
        </div>
    }
}

export default Transaction
